import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import { Layout, Menu, Breadcrumb, Icon } from 'antd';
import NewList from './content/NewList'
import 'antd/dist/antd.css';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import { Link } from 'react-router-dom';
import ListContent from './content/ListContent'
import OldNew from './OldNew'

const { Header, Content, Footer, Sider } = Layout;
const { SubMenu } = Menu;
class NewContent extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    render() { 
        return ( 
                  <Layout style={{ padding: '24px 0', background: '#fff' }}>
        <Sider width={200} style={{ background: '#fff' }}>
          <Menu
            mode="inline"
            defaultSelectedKeys={['1']}
            defaultOpenKeys={['sub1']}
            style={{ height: '100%' }}
          >
            <SubMenu
              key="sub1"
              title={
                <span>
                  <Icon type="laptop" />
                  文章管理
                </span>
              }
            >
              <Menu.Item key="1">文章列表</Menu.Item>
              <Menu.Item key="2">发布文章</Menu.Item>
            
            </SubMenu>
            <SubMenu
              key="sub2"
              title={
                <span>
                  <Icon type="user" />
                  用户管理
                </span>
              }
            >
              <Menu.Item key="5">评论管理</Menu.Item>
              <Menu.Item key="6">用户文章</Menu.Item>
              <Menu.Item key="7">loading</Menu.Item>
              <Menu.Item key="8">loading</Menu.Item>
            </SubMenu>
            <SubMenu
              key="sub3"
              title={
                <span>
                  <Icon type="notification" />
                  栏目管理
                </span>
              }
            >
              <Menu.Item key="9">1</Menu.Item>
              <Menu.Item key="10">2</Menu.Item>
              <Menu.Item key="11">3</Menu.Item>
              <Menu.Item key="12">4</Menu.Item>
            </SubMenu>
          </Menu>
        </Sider>
        <Content style={{ padding: '0 24px', minHeight: 280 }}>
        {/* 中间部分列表<NewList /> */}
         <Layout className="layout">
             <Breadcrumb style={{ padding: '2px',background:'#' }}>
        <Breadcrumb.Item>首页</Breadcrumb.Item>
        <Breadcrumb.Item>文章列表</Breadcrumb.Item>
      </Breadcrumb>
    <Header>
      <div className="logo" />
      <Menu
        theme="dark"
        mode="horizontal"
        defaultSelectedKeys={['1']}
        style={{ lineHeight: '64px' }}
      >
        <Menu.Item key="1"><Link to={'/ListContent'}>全部文章</Link></Menu.Item>
        <Menu.Item key="2"><Link to={'/OldNew'}>已发表</Link></Menu.Item>
        <Menu.Item key="3">草稿箱</Menu.Item>
        <Menu.Item key="4">回收站</Menu.Item>
        <Menu.Item key="5">博客管理</Menu.Item>
        <Menu.Item key="6">博客配置</Menu.Item>
      </Menu>
    </Header>
     <Content>
     <BrowserRouter>
     <Switch>
	      			<Route path='/ListContent' component={ListContent} />
		      		<Route path='/OldNew' component={OldNew} />
		      	</Switch>
     
</BrowserRouter>
    </Content>
     </Layout>
        </Content>
      </Layout>
         );
    }
}
 
export default NewContent;
